import logo from './logo.svg';
import './App.css';
import Comp1 from "./components/comp1.js";
import Comp2 from "./components/comp2.js";
import Comp3 from "./components/comp3.js";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Comp1/>
        <Comp2/>
        <Comp3/>
      </header>
    </div>
  );
}

export default App;
